import React, {createContext, useCallback, useState} from 'react';

const AddQue = () => {
	const [add, setAdd] = useState(false);
	const quesContext = createContext([]);
	const handleAddQue = useCallback((e) => {
		e.preventDefault();
		setAdd(true);
	}, []);


	return (
		<div>
			<button onClick={handleAddQue}>添加问题</button>
			{add && <div>选择问题类型</div>}
		</div>
	);
};

export default AddQue;
